import React from 'react'
import FilterAltIcon from '@mui/icons-material/FilterAlt'

export function MainContext ({ type }) {

    const windowsSwitch = (type) => {
        console.log(type)
        if (type === 'raw-data') {
            return (
                <RawData />
            )
        } else if (type === 'data-visualization') {
            return (
                <DataVisualization />
            )
        } else if (type === 'setting') {
            return <Setting />
        }
    }

    const dataMenu = () => {
        return (
            <div className="file-database">
                <h1 className='datamenus' >Data menu</h1>
                <div className="file-database-list">
                    <text className='filterName'>Today</text>
                    <div className="time-frame today"></div>
                    <text className='filterName'>Last 3 Days</text>
                    <div className="time-frame last-3-day"></div>
                    <text className='filterName'>Last 30 Days</text>
                    <div className="time-frame last-30-day"></div>
                </div>
            </div>
        )
    }
    return (
        <div className="main-content">
            {dataMenu()}
            {windowsSwitch(type)}
        </div>
    )
}
function RawData () {
    return (
        <div className="preview-window">
            <div className="preview-window-content">
                <h3 className='contextData'>Raw Data</h3>
                <div className='rawDataArea'>
                </div>
            </div>
        </div>
    )
}
function DataVisualization () {
    return (
        <div className="preview-window">
            <div className="preview-window-content">
                <h3 className='contextData'>Data Visualization</h3>
                <div className="graphBoard">
                    <div className="graphArea1">
                        <span className="graphType1"></span>
                        <span className="graphSelection"></span>
                    </div>
                    <div className="graphType2">
                        <h2 className='contextData'></h2>
                    </div>
                </div>
            </div>
        </div>
    )
}

function Setting () {
    return (
        <div className="preview-window">
            <div className="preview-window-content">
                <h3 className='contextData'>Setting</h3>
            </div>
        </div>
    )
}
